import "./NewExpense.css"
import ExpenseForm from "./ExpenseForm"

const NewExpense = () => {
    return (
        <form className="new-expense">
            <ExpenseForm/>
            <div className="new-expense button">
                <input type="submit" value="Add Expense"/>
            </div>
        </form>
    );
}

export default NewExpense;
